import { StorageClient } from "@supabase/storage-js";
import { createClient } from "@supabase/supabase-js";
const fs = require("fs");

export default async (req, res) => {
  const bodystr =
    "data:image/jpeg;base64,";

  const supabase = createClient(
    process.env.NEXT_PUBLIC_SUPABASE_URL,
    process.env.SUPABASE_SERVICE_ROLE_KEY
  );

  function dataURLtoFile(dataurl) {
    // const data = dataurl.replace(/^data:image\/\w+;base64,/, "");
    // const buf = Buffer.from(data, "base64");

    // const file = await fs.writeFile("imagea12312.jpg", buf);
    // console.log(file);
    // return buf;

    const imageBase64Str = dataurl.replace(/^.+,/, "");
    const buf = Buffer.from(imageBase64Str, "base64");
    // const file = fs.readFileSync("./image.png");
    // console.log(file);
    return buf;
  }
  const { method } = req;

  switch (method) {
    case "POST":
      try {
        var { name } = req.body;
        console.log(name);
        if (name) {
          const { error } = await supabase.from("Staff").insert({ name: name });
          console.log(error);
          if (!error) {
            var { dataURL } = req.body;
            if (dataURL) {
              const { data, error } = await supabase.storage
                .from("images")
                .upload(name + ".jpg", dataURLtoFile(dataURL), {
                  contentType: "image/jpeg",
                  upsert: true,
                });
              if (data) res.status(200).json({ success: true });
              else res.status(400).json({ error: error.details });
            }
          } else res.status(400).json({ error: error.details });
        }
      } catch (error) {
        res.status(400).json({ error: "Unknown" });
      }
      break;
    default:
      res.status(400).json({ error: "Unknown" });
      break;
  }
};
